import{_ as a,c as t,o as n,ag as o}from"./chunks/framework.Ds6Eueu6.js";const E=JSON.parse('{"title":"ALTER EXTERNAL TABLE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_EXTERNAL_TABLE.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_EXTERNAL_TABLE.md"}'),s={name:"docs/7x/ref_guide/sql_commands/ALTER_EXTERNAL_TABLE.md"};function i(l,e,r,c,d,p){return n(),t("div",null,e[0]||(e[0]=[o(`<h1 id="alter-external-table" tabindex="-1">ALTER EXTERNAL TABLE <a class="header-anchor" href="#alter-external-table" aria-label="Permalink to &quot;ALTER EXTERNAL TABLE&quot;">​</a></h1><p>Changes the definition of an external table.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER EXTERNAL TABLE &lt;name&gt; &lt;action&gt; [, ... ]</span></span></code></pre></div><p>where action is one of:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>  ADD [COLUMN] &lt;new_column&gt; &lt;type&gt;</span></span>
<span class="line"><span>  DROP [COLUMN] &lt;column&gt; [RESTRICT|CASCADE]</span></span>
<span class="line"><span>  ALTER [COLUMN] &lt;column&gt; TYPE &lt;type&gt;</span></span>
<span class="line"><span>  OWNER TO &lt;new_owner&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER EXTERNAL TABLE</code> changes the definition of an existing external table. These are the supported <code>ALTER EXTERNAL TABLE</code> actions:</p><ul><li><strong>ADD COLUMN</strong> — Adds a new column to the external table definition.</li><li><strong>DROP COLUMN</strong> — Drops a column from the external table definition. If you drop readable external table columns, it only changes the table definition in WarehousePG. The <code>CASCADE</code> keyword is required if anything outside the table depends on the column, such as a view that references the column.</li><li><strong>ALTER COLUMN TYPE</strong> — Changes the data type of a table column.</li><li><strong>OWNER</strong> — Changes the owner of the external table to the specified user.</li></ul><p>Use the <a href="./ALTER_TABLE.html">ALTER TABLE</a> command to perform these actions on an external table:</p><ul><li>Set (change) the table schema.</li><li>Rename the table.</li><li>Rename a table column.</li><li>Set (change) the distribution policy (writable external table only).</li></ul><p>You must own the external table to use <code>ALTER EXTERNAL TABLE</code> or <code>ALTER TABLE</code>. To change the schema of an external table, you must also have <code>CREATE</code> privilege on the new schema. To alter the owner, you must also be a direct or indirect member of the new owning role, and that role must have <code>CREATE</code> privilege on the external table&#39;s schema. A superuser has these privileges automatically.</p><p>Changes that you make to an external table definition with either <code>ALTER EXTERNAL TABLE</code> or <code>ALTER TABLE</code> do not affect the external data.</p><p>The <code>ALTER EXTERNAL TABLE</code> and <code>ALTER TABLE</code> commands cannot modify the type of the external table (read, write, web), the table <code>FORMAT</code> information, or the location of the external data. To modify this information, you must drop and recreate the external table definition.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name (possibly schema-qualified) of an existing external table definition to alter.</p><p>column : Name of an existing column.</p><p>new_column : Name of a new column.</p><p>type : Data type of the new column, or new data type for an existing column.</p><p>new_owner : The role name of the new owner of the external table.</p><p>CASCADE : Automatically drop objects that depend on the dropped column, such as a view that references the column.</p><p>RESTRICT : Refuse to drop the column or constraint if there are any dependent objects. This is the default behavior.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Add a new column to an external table definition:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER EXTERNAL TABLE ext_expenses ADD COLUMN manager text;</span></span></code></pre></div><p>Change the owner of an external table:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER EXTERNAL TABLE ext_data OWNER TO jojo;</span></span></code></pre></div><p>Change the data type of an external table:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER EXTERNAL TABLE ext_leads ALTER COLUMN acct_code TYPE integer;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>ALTER EXTERNAL TABLE</code> is a WarehousePG extension. There is no <code>ALTER EXTERNAL TABLE</code> statement in the SQL standard or regular PostgreSQL.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_EXTERNAL_TABLE.html">CREATE EXTERNAL TABLE</a>, <a href="./DROP_EXTERNAL_TABLE.html">DROP EXTERNAL TABLE</a>, <a href="./ALTER_TABLE.html">ALTER TABLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,34)]))}const u=a(s,[["render",i]]);export{E as __pageData,u as default};
